def mark_repeated_names(names, desc, flag):
    # 为了给重复的参数名，以添加后缀"-1"或“-2"的形式重命名，
    # 并且删除没有数据的列名，其描述为'Parameter not present'
    i = 0
    while i < len(names):
        if desc[i] == flag:
            del names[i], desc[i]
            continue
        j = 1
        while (j < 8) and (i+j < len(names)):
            if names[i] == names[i+j]:
                names[i+j] = names[i+j] + '-' + str(j)
                j += 1
            else:
                break
        i += j
    return names

